import React from "react";
import "./Footer.css";
import footerData from "../../data/footer.json";

const Footer = () => {
  return (
    <div className="footerContainer">
      <div className="fLists">
      <ul className="fList">
        {footerData.map((props) => (
          
            <li className="fListItem">
              {props.col_values}
            </li>
        
        ))}
          </ul>
      </div>
    </div>
  );
};

export default Footer;
